export const leftItems = [
  { as: "NavLink", content: "Home", key: "home", to: "/" },
  { as: "NavLink", content: "About", key: "about", to: "/abput" },
  { as: "NavLink", content: "Quote of the day", key: "quote", to: "/quote" },
  { as: "NavLink", content: "Progress", key: "progress", to: "/weights" }
];
export const rightItems = [
  { as: "NavLink", content: "Login", key: "login", to: "/login" },
  { as: "NavLink", content: "Sign up", key: "signup", to: "/signup" }
];
